INSERT INTO inicio_proyecto VALUES(1,'Club Infantil Barrio','Lo realizamos en el Colegio Bachiller Alonso López en Alcobendas. En este proyecto a través de una metodología participativa realizamos un proyecto educativo basado en la educación no formal. Nuestro proyecto está destinado a niños/as de 4-12 años. El horario de la actividad es los viernes de 18:00 a 19:30 (puede variar en función del tipo de actividad).','static/resources/logos/Logo_Yambo2.png.webp');
INSERT INTO inicio_proyecto VALUES(2,'Club Juvenil Jamboloko','Lo realizamos en el Centro Cultural Miguel Delibes de Alcobendas. En este proyecto a través de una metodología participativa realizamos un proyecto educativo basado en la educación no formal. Está dirigido a adolescentes de edades comprendidas entre 13 y 18 años. El horario de la actividad es de 18:00 a 19:30 (puede variar en función de la actividad)','static/resources/logos/JamboLoco_logo_de_frente_preview_rev_1.png.webp');
