INSERT INTO monitores_monitor VALUES(5,'Paula',replace(replace('Hola soy Paula!!!\r\nEstudio para llegar a ser profe🧑‍🏫, porque me encantan los niños, especialmente los yamberos.\r\nMe gustan muchísiiiimoo los abrazos, hacer cosquillas y reír mucho🙃, además mi parte favorita de los viernes es cuando cantamos todos juntos alguna canción🎶.\r\nEntré en yambo hace poquito y estoy súper contenta de haber entrado.','\r',char(13)),'\n',char(10)),'fotos_monitores/paula.jpg');
INSERT INTO monitores_monitor VALUES(7,'Lukas',replace(replace('Estudiante de artes🎨, me uní a Yambo porque quería hacer algo nuevo y al final me acabo gustando💚, este es mi primer año de monitor :b\r\nPues porque me llevaba tiempo queriendo hacer algún trabajo como niñero o monitor y está fue una oportunidad perfecta para ello 🤭🤭','\r',char(13)),'\n',char(10)),'fotos_monitores/lukas.jpg');
INSERT INTO monitores_monitor VALUES(8,'Irene',replace(replace('Holaa me llamo Irene !\r\nSoy Técnico en emergencias sanitarias🚑 actualmente estoy estudiando integración social.♿En un futuro me gustaria estudiar enfermería !💉💊\r\nFui niña de yambo y no me quería ir así que me quedé como moni y cada día estoy más contenta de haberme quedado como moni🙃','\r',char(13)),'\n',char(10)),'fotos_monitores/irene.jpg');
INSERT INTO monitores_monitor VALUES(9,'Samu',replace(replace('Un niño de 22 años , Amante de los animales❤️ (sobretodo los pandas)🐼.\r\nCuarto año en Yambo con muchas ganas de volver a las actividades 💪y jugar a todos los juegos posibles🤹. Súper fanático del verano🌅 y de las épocas calurosas🌡️ para bajar al parque a jugar a las cartas🎴 o juegos de mesa🎲','\r',char(13)),'\n',char(10)),'fotos_monitores/samu.jpg');
INSERT INTO monitores_monitor VALUES(11,'Carlota','Soy estudiante de enfermería , me considera sincera y cercana , llevo varios años en diferentes asocias y este año entro a yambo con toda mi energía y motivación , soy espérate en sacar sonrisas 💚','fotos_monitores/carlota.jpg');
INSERT INTO monitores_monitor VALUES(14,'Mini campi',replace(replace('Musicólogo y Técnico de sonido para audiovisuales y espectáculos. Amante de la música, el arte, la historia, la política, los animales y el campo.\r\n\r\nLleva casi 8 años (en diciembre hago 9 años) en Yambo, actual Presidente de la Asociación, monitor de referencia del proyecto juvenil Jamboloko y próximo coordinador titulado.','\r',char(13)),'\n',char(10)),'fotos_monitores/campi.jpg');
INSERT INTO monitores_monitor VALUES(16,'Javier',replace(replace('Soy Javier, un informático👨‍💻 que está estudiando desarrollo de aplicaciones web🌐.\r\nEn 2018 entré como niño a Yambo, y ahora en 2022 decidí darle la vuelta a la carta 🃏y evolucionar a moni','\r',char(13)),'\n',char(10)),'fotos_monitores/javier.jpg');
INSERT INTO monitores_monitor VALUES(17,'Ekiñe',replace(replace('Estudio filología clásica 🎭 porque en el futuro me gustaría ser profesora 👩‍🏫 o dedicarme a la investigación 🔬. Entre en yambo para probar cosas nuevas y he descubierto que me encanta ser monii 🐘\r\n Espero estar mucho más tiempo  🕐y seguir pasándolo tan bien','\r',char(13)),'\n',char(10)),'fotos_monitores/e.jpg');
INSERT INTO monitores_monitor VALUES(18,'Lucía',replace(replace('Holaa, soy Lucía!!\r\n\r\nEstoy estudiando artes🎨, aunque me encantan la filosofía📜 y la psicología🧠, también me encanta el teatro🎭, las manualidades🧶, la música🎶, reír y hacer reír☺️\r\nFui niña de yambo los 9 años que estuve en el bachi y como ya sabéis…\r\nuna vez yambero, siempre yambero💚\r\nAsí que he vuelto como moni con un montón de ganas de pasarlo genial cada viernes con todos los nuevos yamberos y yamberass!!✨','\r',char(13)),'\n',char(10)),'fotos_monitores/IMG-20240219-WA0013.jpg');
INSERT INTO monitores_monitor VALUES(19,'Laura',replace(replace('Hola! Soy estudiante de Integración Social y quiero estudiar Psicología🧠\r\nEste es mi primer año de moni💪🏻 y aunque entré de forma inesperada estoy super feliz de ser yambera💚','\r',char(13)),'\n',char(10)),'fotos_monitores/IMG-20240219-WA0021.jpg');
